import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card } from 'react-bootstrap';

function Technical() {
    return (
        <div className='container'>
            <h3>Technical Skills</h3>

            <Card bg='dark' text='light'>
                <Card.Header as="h6">Technical Skills</Card.Header>
                <Card.Body>
                    <Card.Text>
                        Java{<br />}
                        Python{<br />}
                        MySQL{<br />}
                        Object Oriented Programming (OOP) {<br />}
                        Agile Extreme Programming{<br />}
                        Junit Testing{<br />}
                        Systems Design{<br />}
                        GitHub{<br />}
                        Java Database Connectivity (JDBC){<br />}
                        Microsoft Word, Excel, Power point, Outlook{<br />}
                        Local Area Network (LAN){<br />}
                        Sales{<br />}
                        Direct Marketing{<br />}

                    </Card.Text>
                </Card.Body>
            </Card>
            <br/>

            <Card bg='dark' text='light'>
                <Card.Header as="h6">Basic Skills</Card.Header>
                <Card.Body>
                    <Card.Text>
                        HTML{<br />}
                        CSS{<br />}
                        React{<br />}  
                    </Card.Text>
                </Card.Body>
            </Card>
            <br/>

            <h3>Basic Skills</h3>
            <ul>
                <li> HTML </li>
                <li> CSS </li>
            </ul>

            <h3>Soft Skills</h3>
            <ul>
                <li> Communication </li>
                <li> Analytical </li>
                <li> Adaptable </li>
                <li> Problem Solving </li>
                <li> Collaborative</li>
                <li> Critical Thinking</li>
                <li> Effective communication formal and informal</li>
                <li> Time management</li>
                <li> Conflict resolution</li>
                <li> Risk management</li>					
            </ul>
        </div>      
    );
  }
  
  export default Technical;
